import { load } from '@cashfreepayments/cashfree-js';

async function initializeCashfree() {
  try {
    const cashfree = await load({ mode: "production" });
    return cashfree;
  } catch (error) {
    console.error("Error initializing Cashfree:", error);
    throw error;
  }
}

export default initializeCashfree;
